INSERT INTO `projecten` (`ID`, `Titel`, `Omschrijving`, `Datum`, `Plaatje`) VALUES
(47, 'Dobbelsteenspel', 'Spel waarbij je 1v1 dobbelt. Je moet je tegenstander als eerste af zien te maken door te dobbelen met de dobbelsteen. Het aantal wat je dobbelt gaat van je levens af. Om het wat interessanter te maken heb ik twee special attacks toegevoegd. De eerst zorgt ervoor dat de helft van de tegenstander zijn damage eraf gaat. Dit kan wel alleen pas als de hp van de tegenstander tussen de 11 en de 20 zit. De tweede special attack healt het dubbel van je levens als je hp 10 of minder is.', '2020-03-30', );
INSERT INTO `projecten` (`ID`, `Titel`, `Omschrijving`, `Datum`, `Plaatje`) VALUES
(51, 'Make a Match', 'Make a Match is een soort drie op een rij alleen dan anders. Het werkt namelijk met kleuren en de grote van de rondjes. Je kan ook kleinere rondjes in grotere rondjes zetten, zodat er soort van 2 rondjes inpassen. Om het spel moeilijker te maken ga je per 30 points een level omhoog en als je level omhoog gaat komt er een nieuwe kleur bij. Er zit ook nog een database achter die de gegevens opneemt.', '2020-04-08', );
